function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<VRLandingPage />} />
          <Route path="catalog" element={<HomePage />} />
          {/* Добавь другие страницы, если нужно */}
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
export default App;
